import React from "react";

function PromoVideo(props) {
  return (
    <>
      <div className={props.videoDiv}>
        <iframe
          className={props.iframe}
          src={props.src}
          allowFullScreen
        ></iframe>
      </div>
    </>
  );
}

export default PromoVideo;
